std::string format_html(const std::string& md) {
  std::stringstream ss;
  for (auto &c : md) {
    switch (c) {
      case '*':
        ss << "<strong>";
        break;
      case '_':
        ss << "<em>";
        break;
      default:
        ss << c;
    }
  }
  return ss.str();
}
